import { Route, Routes, Navigate, Outlet, useLocation } from 'react-router-dom';
import { useEffect } from 'react';
import { Home } from './pages/Home';
import { ProductList } from './pages/ProductList';
import { ProductDetail } from './pages/ProductList';
import { Login } from './pages/Login';
import { Signup } from './pages/Signup';
import { Provider } from 'react-redux';
import store from './store';
import { AuthProvider, useAuth } from './context/AuthContext';
import NavigationBar from './components/NavigationBar';
import { Unauthorized } from './pages/Unauthorized';
import Cart from './pages/Cart';
import AddProduct from './pages/AddProduct';

const App = () => {
  // Funcția pentru crearea unui admin
  const addAdmin = async () => {
    try {
      const response = await fetch('http://localhost:8080/auth/register', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({
          first_name: 'Admin',
          last_name: 'User',
          username: 'admin_user',
          password: '123456',
          email: 'user@admin.com',
          role: 'admin'
        }),
      });
      if (!response.ok) throw new Error('Network response was not ok');
    } catch (error) {
      console.error('Error registering user:', error);
    }
  };

  useEffect(() => {
    addAdmin();  // Se va executa o singură dată când aplicația este pornită
  }, []);

  return (
    <Provider store={store}>
      <AuthProvider>
        <NavigationBar />
        <Routes>
          {/* HOME */}
          <Route exact path="/" element={<Home />} />
          <Route exact path="/home" element={<Home />} />

          <Route exact path="/products" element={<ProductList />} />          
          <Route path="/product/:id" element={<ProductDetail />} />

          {/* AUTH */}
          <Route exact path="/login" element={<Login />} />
          <Route exact path="/signup" element={<Signup />} />

          {/* ADMIN PAGES */}
          <Route exact path="/add-product" element={<PrivateAdminRoute />}>
            <Route exact path="/add-product" element={<AddProduct />} />
          </Route>

          {/* CART PAGE */}
          <Route exact path="/cart" element={<PrivateRoute />}>
            <Route exact path="/cart" element={<Cart />} />
          </Route>

          {/* UNAUTHORIZED PAGE */}
          <Route exact path="/unauthorized" element={<Unauthorized />} />
        </Routes>
      </AuthProvider>
    </Provider>
  );
};

// Ruta protejată pentru utilizatori autentificați
const PrivateRoute = () => {
  const { state } = useAuth();  // Obținem informațiile de autentificare din context
  const location = useLocation();  // Pentru a salva locația curentă

  return state.isAuthenticated ? (
    <Outlet />  // Dacă utilizatorul este autentificat, afișăm conținutul
  ) : (
    <Navigate state={{ from: location }} to="/login" />  // Dacă nu este autentificat, redirecționăm la Login
  );
};

// Ruta protejată pentru admini
const PrivateAdminRoute = () => {
  const { state } = useAuth();
  const location = useLocation();

  return state.isAuthenticated ? (
    state.isAdmin ? (  // Dacă utilizatorul este admin, afișăm conținutul
      <Outlet />
    ) : (
      <Navigate to="/unauthorized" />  // Dacă nu este admin, redirecționăm la pagina Unauthorized
    )
  ) : (
    <Navigate state={{ from: location }} to="/login" />  // Dacă nu este autentificat, redirecționăm la Login
  );
};

export default App;
